oxy_webhelp_navlinks = {"retention_management-d23139e41131":{"topics":[{"title":"Snapshot types","shortdesc":"<p class=\"shortdesc\">Information about types of the snapshots. Each snapshot is a fully functional,         current copy of the source object.<\/p>","href":"cdm\/snapshots_types_2.html","attributes":{"data-id":"snapshots_types"},"menu":{"hasChildren":false},"tocID":"snapshots_types-d23139e41142","topics":[]},{"title":"Object filters for snapshot retention","shortdesc":"<p class=\"shortdesc\">Information about the filters that you can apply to the objects on the Snapshot         Retention page. These filters are available on the Data Center and Cloud tabs of the         Snapshot Retention page.<\/p>","href":"cdm\/object_filters_snapshot_retention.html","attributes":{"data-id":"object_filters_snapshot_retention"},"menu":{"hasChildren":false},"tocID":"object_filters_snapshot_retention-d23139e41153","topics":[]},{"title":"Snapshot expiration behavior","shortdesc":"<p class=\"shortdesc\">The snapshot expiration behavior is determined by its configured retention period.         This behavior dictates when a snapshot is deleted, ensuring your storage is optimized while         critical data is retained.<\/p>","href":"cdm\/snapshot_expiry.html","attributes":{"data-id":"snapshot_expiry"},"menu":{"hasChildren":false},"tocID":"snapshot_expiry-d23139e41164","topics":[]},{"title":"Changing the retention period of a snapshot","shortdesc":"<p class=\"shortdesc\">Change the retention period of a snapshot of data center or cloud native workload objects.<\/p>","href":"saas\/changing_retention_period_snapshot_2.html","attributes":{"data-id":"changing_retention_period_snapshot"},"menu":{"hasChildren":false},"tocID":"changing_retention_period_snapshot-d23139e41175","topics":[]},{"title":"Changing the retention period of multiple objects","shortdesc":"<p class=\"shortdesc\">Change the retention period of all the snapshots of an object or multiple objects         associated with a workload object of a cluster or cloud native workload. <\/p>","href":"saas\/changing_retention_multiple_objects_2.html","attributes":{"data-id":"changing_retention_multiple_objects"},"menu":{"hasChildren":false},"tocID":"changing_retention_multiple_objects-d23139e41186","topics":[]},{"title":"Deleting a snapshot","shortdesc":"<p class=\"shortdesc\">Delete a specific snapshot or multiple snapshots of a workload object or multiple         objects when you want to identify unmanaged snapshots and perform cleanup activity to reduce         cloud costs, respectively.<\/p>","href":"saas\/deleting_individual_snapshots.html","attributes":{"data-id":"deleting_snapshots"},"menu":{"hasChildren":false},"tocID":"deleting_snapshots-d23139e41197","topics":[]},{"title":"Searching for an object on the Snapshot Retention page","shortdesc":"<p class=\"shortdesc\">Search for a specific object by object name on the Snapshot Retention         page.<\/p>","href":"saas\/searching_object_on_snapshot_retention_page.html","attributes":{"data-id":"search_object_on_snapshot_retention_page"},"menu":{"hasChildren":false},"tocID":"search_object_on_snapshot_retention_page-d23139e41208","topics":[]},{"title":"Reader cluster workload refresh","shortdesc":"<p class=\"shortdesc\">Refreshing workloads on the reader Rubrik cluster synchronizes the recovery view of         the reader cluster with the contents of the archival location.<\/p>","href":"cdm\/reader_cluster_workload_refresh_3.html","attributes":{"data-id":"reader_cluster_workload_refresh"},"menu":{"hasChildren":false},"tocID":"reader_cluster_workload_refresh-d23139e41219","next":"reader_cluster_workload_refresh-d23139e41219"},{"title":"Relic data sources","shortdesc":"<p class=\"shortdesc\">A data source is designated as a relic if it is managed by, but is no longer         accessible to the Rubrik cluster.<\/p>","href":"cdm\/cdm_relic_data_sources.html","attributes":{"data-id":"cdm_relic_data_sources"},"menu":{"hasChildren":false},"tocID":"cdm_relic_data_sources-d23139e41244","topics":[]},{"title":"Intelligent Data Lock","shortdesc":"<p class=\"shortdesc\">Intelligent Data Lock is a feature that protects your account from malicious activity         by delaying the deletion of the snapshots of the data sources backed up by Rubrik         clusters.<\/p>","href":"common\/intelligent_data_lock_2.html","attributes":{"data-id":"intelligent_data_lock"},"menu":{"hasChildren":false},"tocID":"intelligent_data_lock-d23139e41255","topics":[]}]}};